import React from 'react';
import './Home.css';
import facebook from '../img/facebook.svg';
import instagram from '../img/instagram.svg';
import linkedin from '../img/linkedin.svg';
import weixin from '../img/weixin.svg';
import github from '../img/github.svg';
import notion from '../img/notion.svg.png';


function Home() {
  return (
    <div> 
      <div className='image-container'>
        <img src="1" alt="my-pic" />
      </div>
      <div className='paragraph-container'>
        <h1>Hello <span>I'm</span></h1>
        <h1>Zhang Yu-Cheng</h1>
        <span>a former accountant, and now a front end developer</span>
        <p>I graduated from National Chung Cheng University in Taiwan and majored in Finance. My first job started at PricewaterhouseCoopers / 普华永道中天会计师事务所（特殊普通合伙）in Shanghai as an auditor. In my first year of working at PwC, I found bussine management is not what I want do. So I decided to make a career change.
        </p>
      </div>
      <div className='social-media'>
        <a href="https://www.facebook.com/profile.php?id=100000344426858" target='_blank'>
          <img src={facebook} alt="facebook-logo" />
        </a>
        <a href="https://www.instagram.com/anson_1998syat/" target='_blank'>
          <img src={instagram} alt="instagram-logo" />
        </a>
        <a href="https://www.linkedin.com/in/yucheng-zhang-22a416120/" target='_blank'>
          <img src={linkedin} alt="instagram-logo" />
        </a>
        <img src={weixin} alt="instagram-logo" />
        <a href="https://github.com/Anson-y-chang" target='_blank'>
          <img src={github} alt="instagram-logo" />
        </a>
        <a href="https://boiling-song-6da.notion.site/Coding-c804658730d04773984a05b3dccc27b8" target='_blank'>
          <img src={notion} alt="instagram-logo" />
        </a>
      </div>

    </div>
  );
}

export default Home;
